INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4113', 'STENKUMLA SNÄCKARVE 1:31', '2018-11-21', 'Kontakt i ärendet', 'Niklas Holmbom, FaÄ, undrade lite allmänt om vad som gäller för hans fastighet, och hur han ska göra sin ansökan. Han har en trekammarbrunn som han eventuellt vill behålla och en gammal infiltration under marknivå. Jag gav honom generell information om hur han kan utforma sin ansökan. Han undrade om han kunde ansöka nu och gräva grop senare men kom själv fram till att det är bättre att vänta och kontakta en grävare i vår. Niklas fick även information om att ansökan ska ha inkommit till oss senast två år från första utskicket, dvs. om knappt ett år.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4100', 'STENKUMLA MYRSE 1:19', '2018-11-01', 'Kontakt i ärendet', 'Fä undrar över utskicket. / JL');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4097', 'STENKUMLA MARTILLE 1:29', '2019-02-07', 'Kontakt i ärendet', 'FaÄ förklarade att det var svårt att anlägga nytt avlopp pga ekonomiska omständigheter. Jag förklarade KV-processen, dvs. ansökan senast 2019-10 och därefter ytterligare två år tills anläggningen ska vara klar. De förklarade att det finns provgropar från grannens tidigare bygglovsärende, verkar vara sand i fastighetens östra del.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4093', 'STENKUMLA MARTILLE 1:20', '2019-02-01', 'Kontakt i ärendet', 'Hej Lars,
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4231', 'STENKUMLA LILLA HOME 1:31', '2019-09-20', 'Kontakt i ärendet', 'FaÄ ringer då någon från klartvatten hade ringt entreprenören och meddelat att det inte har kommit in någon ansökan. Kund sa att hon skickade in ansökan digitalt den 18 juni. Kund vill att ni kollar på detta och kontaktar kund. Tel: 0738159557. /Jahn08');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4227', 'STENKUMLA LARSARVE 1:7', '2019-06-04', 'Kontakt i ärendet', 'Fä på besök. Ansökan på gång. Ska kontakta entrep. / JL');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4224', 'STENKUMLA LARSARVE 1:17', '2019-04-09', 'Kontakt i ärendet', 'Fä ringer. Vill ha entreprenörslista. Skickar länkar via mail.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4220', 'STENKUMLA KÄLLGÅRDS 1:58', '43419', 'Kontakt i ärendet', 'Synpunkter inlagda i annat ärende. Överför dessa till KV ärendet eftersom det är här informationen ska vara och avslutar det andra ärendet 2018/4770. / JL');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4212', 'STENKUMLA KÄLLGÅRDS 1:33', '2019-06-12', 'Kontakt i ärendet', 'FaÄ på besök, har börjat planera för ansökan. Han undrade över hur vi resonerar kring alternativa lösningar såsom actnatural eller minireningsverk. Jag svarade att han får söka så prövar vi det. Meddelade att de vanligaste besluten vi skriver på mindre anläggningar är slamavskiljare och efterföljande infiltration. FaÄ fick tips om avloppsguiden och vi gick igenom ansökningsformuläret. Meddelade att man får göra anläggningen själv om sakkunskapen finns. FaÄ funderar på att göra anläggningen själv.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4210', 'STENKUMLA KÄLLGÅRDS 1:28', '2019-03-18', 'Kontakt i ärendet', 'Fä undrar över avloppsanläggningen som är från -84. Ges information om hur han kan gå tillväga inför planering av ansökan.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4209', 'STENKUMLA KVIUNGS 1:6', '2018-11-23', 'Kontakt i ärendet', 'Fastighetsägarna var på besök och fick info. om avloppslösningar, samt ansökningsblankett. De är på gång och ska ansöka om förbättringsåtgärder. Marianne');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4204', 'STENKUMLA KVIUNGS 1:29', '2018-11-26', 'Kontakt i ärendet', 'FÄ planerar för att ordna med ansökan för gemensam fastighet för 6 hushåll. Anläggningen är omgjord utan tillstånd någon gång ca. -99. Tveksamt om det går att ansöka i efterhand på en 20 år gammal bädd. Kontsktar entyr. för försla på åtgärder och ska prata med alla andra FÄ. Planerar åtgärder under 2019.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4195', 'STENKUMLA KUBE 1:8', '2018-12-04', 'Kontakt i ärendet', 'Fastighetsägaren ska ta tag i att komma in med ansökan inom kort. Kommer ansöka om gemensam anläggning, med grannarna på Stenkumla Kube 1:9 och 1:10. 
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4192', 'STENKUMLA GRENSTORP 1:3', '2019-06-03', 'Kontakt i ärendet', 'FaÄ ringde och ville ha information om hur hon ska gå tillväga med sin ansökan. Hänvisade henne till att ta kontakt med entreprenör samt fylla i ansökan tsm med dem. Kund uppgav även att hon har en separett men kommer ändå ansöka om förbättring av befintligt avlopp//aenn09');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4186', 'STENKUMLA GARDRUNGS 1:74', '2018-12-11', 'Kontakt i ärendet', 'Bekräftar att ansökan ska vara inne senast 12 okt 2019. Skickar inspektionsrapport för 1:71 (med gemensam bädd) till fastighetsägaren.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4184', 'STENKUMLA GARDRUNGS 1:72', '2018-11-02', 'Kontakt i ärendet', 'Fastighetsgaren (Tony) undrade vad som gäller, egentligen. Han uppfattade vår påminnelse som att ansökan ska vara inne före 2019 (innan ev besiktning av oss). Jag meddelade då att det fortfarande är samma datum som tidigare, som gäller, att komma in med ansökan, dvs. den 12 oktober 2019. 
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4146', 'STENKUMLA GARDRUNGS 1:35', '2019-01-21', 'Kontakt i ärendet', 'Fastigheten är under försäljning. Svarat mäklaren:
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4135', 'STENKUMLA GARDRUNGS 1:26', '2019-05-21', 'Kontakt i ärendet', 'Samtal med Leif Tullhage som inte har fått riktig respons ännu från grannarna om att göra ett gemensamt avlopp. Planer finns på reningsverk med upptill 12 ingående fastigheter. Meddelar att den totala tiden (initierat ärende till utförd avloppsanläggning) är 4 år, men då ska anläggningen vara klar och redovisad. Lämpligt är att under året lämna in ansökningshandlingar. Enligt provgrop (2005) på tomten är marken bra för infiltration.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4124', 'STENKUMLA GANNARVE 1:3', '2018-12-06', 'Kontakt i ärendet', 'Fastighetsägaren, tillika gräventreprenör, Rune Hallberg var inne på besök. Han ska gräva sitt eget avlopp. 
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4094', 'STENKUMLA FORSE 1:19', '2018-11-02', 'Utskick Returnerat', 'funkade heller inte på Bäckafall Hjo');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4064', 'STENKUMLA ANSARVE 1:20', '43445', 'Information om', 'Till handläggare; Jag och MAN har utrett detta. Kartegografiska info visade 3 attribut och fel färg i flaggskikten. Har återställt detta. Det ena huset har status lila med ett tillstånd. Det andra huset med röd flagg är det hus som är aktuellt för förbättring av avlopp. Jag kommer att ringa fä idag  och meddela detta nu, när vi rett ut det här. / JL');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3997', 'RUTE STORA VALLE 1:43', '2018-11-01', 'Kontakt i ärendet', 'Hej,
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3921', 'RUTE RISUNGS 1:5', '2018-12-03', 'Kontakt i ärendet', 'FaÄ meddelade att han försöker få tag på en entreprenör och kommer skicka in en ansökan innan oktober 2019. / FT');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3900', 'RUTE RISUNGS 1:18', '2018-11-07', 'Kontakt i ärendet', 'Fastighetsägare, 0498 228197, ringde och frågade vad hon förväntas göra. Hon menar att avloppet gjordes om 2001 men är osäker. Hittar ett beslut från -95 om påkoppling på befinltlig anläggning. Fastighetsägaren ombeds ta reda på mer om sin nuvarande anläggning och höra av sig igen.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4203', 'RUTE PUTTERSJAUS 1:24', '2019-08-29', 'Kontakt i ärendet', 'FaÄ ringer och ber mig skicka en ansökan om enskilt avlopp per post. Skickar dessa till Stenkumla Väg 22, 62147 Visby. //aenn09');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4197', 'RUTE PUTTERSJAUS 1:14', '2019-06-12', 'Kontakt i ärendet', 'Maken till dödsbodelägare, (Bruno Stuxberg) låter meddela att fastigheten är ute till försäljning. //aenn09');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4188', 'RUTE NORS 1:14', '2018-11-01', 'Kontakt i ärendet', 'Hej,
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4179', 'RUTE LILLA VALLE 1:17', '2018-11-06', 'Kontakt i ärendet', 'FaÄ på besök. -fick entreprenöslsta och info om vad de behöver göra, dvs. kontakta en entreprenör och skicka in en ansökan. / FT');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4114', 'RUTE BRÄNTINGS 1:17', '2019-08-14', 'Kontakt i ärendet', 'FaÄ hör av sig till Kundtjänsten och vill ha besiktning på avloppsanläggning. Då anläggningen saknar tillstånd får FaÄ information att han måste komma in med ansökan, antingen om tillstånd i efterhand eller nyanläggning och att besiktning sker i samband med handläggning./AN');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4043', 'RUTE BRÄNTINGS 1:10', '2019-05-16', 'Kontakt i ärendet', 'Fä ringer och frågar när hans ansökan ska komma in. Undrar över minireningsverk för BDT och hur vi ser på saken. Talar om att vi inte kan säga vilka reningsverk som är bra eller dåliga, utan jag ger mer generell information och ber honom ta kontakt med entreprenör. /CB');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3955', 'RUTE ALVANS 1:44', '2018-11-21', 'Kontakt i ärendet', 'Ny FaÄ undrade varför han fått utskick. Avloppet var nyanlagt enligt uppgift från tidigare ägare. Finns beslut från 2007. FaÄ ber entreprenören skicka in utförandeintyg på anläggningen. FaÄ meddelar att anläggningen togs i bruk först 2016. Jag meddelade att vi hör av oss när vi fått intyget om vi behöver titta mer på fastigheten, dvs. om avloppet inte är grävt inom tid för beslut.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3925', 'RUTE ALE 1:42', '2018-11-22', 'Kontakt i ärendet', 'Markbädd på 20 kvm, under marknivå, ingen luftning/pumpning, översvämmad 3 kb, utförd 91. Behövs förbättras. Har befintlig bädd möjligen tätnat? Moränlera, oklart var grundvattenlinjen är. Besiktad via MSO hösten 2017. Fick kritik. / JL');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3925', 'RUTE ALE 1:42', '2018-11-22', 'Kontakt i ärendet', 'Mitt svar (se fä:s fråga i mail nedan) / JL
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3772', 'RUTE ALBY 1:4', '2018-11-08', 'Information om - adress/tfn nr', 'Dödsbo. Alla utskick ska gå till följande adress,
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3837', 'HELLVI VIVLINGS 1:83', '2018-11-29', 'Kontakt i ärendet', '2 brödrar som delar fa och bara 1 som fick utskick. Utskick ska också gå till Mats Estonius, Molkombacken, 35 lgh 1102, 123 33 farsta. /Frtidsfastighet med vatten indraget. Finns ett rör in till ett kök, rör ut och vidare rening i stenkista av betong (inget tillst). Dass ute, dusch ute. / Sa till fä att plombering kan vara ett alternativ men detta ska veriferas / Fä föreslog att ansöka om att behålla stenkista som 2kb med rening i infiltra. Sa att stenkistor är en föråldrar teknik på väg ut. Har aldrig hört om en sådan lösning tidigare. Ansöka går men kan inte svara för om detta kommer att gå igenom. / Fä vill veta om hen kan få uppskov med sin ansökan eller plombering till 12 okt 2019. Svarade att uppskov meddelas bara i allvarliga fall som ex svår sjukdom/dödsfall. / JL');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3834', 'HELLVI VIVLINGS 1:82', '2018-12-20', 'Kontakt i ärendet', 'FaÄ, Jörgen Axelsson, undrade hur han ska gå tillväga. Han och grannen på 1:18 har gemensam anläggning och vill fortsätta med det. De rekommenderades att med hjälp av sakkunnig ta fram en ansökan. Meddelade att ansökan ska vara inne senast okt 2019.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3824', 'HELLVI VIVLINGS 1:64', '2018-11-02', 'Kontakt i ärendet', 'Ansökan inkommer våren 2019. Letar efter ny plats för infiltration. Ska göra gem avlopp med grannfastigheterna. / JL');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3822', 'HELLVI VIVLINGS 1:51', '2018-12-06', 'Kontakt i ärendet', 'Fä ringde. Har till 12 okt 2019 på sig att skicka in sin ansökan. / JL');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3751', 'FOLE STORA HELLVIS 1:28', '2019-08-21', 'Kontakt i ärendet', 'Entreprenören Micael B. har hört av sig. Han håller på att fylla i ansökningar för denna och två grannfastigheter (1:10 och 1:11). Vi diskuterade att det nog är klokt att vi gör ett platsbesök ihop med honom när ansökningarna kommit in. Brucesson M. har tel. 070-3122482. Marianne');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3717', 'FOLE NYGÅRDS 1:19', '2018-12-14', 'Kontakt i ärendet', 'Fä ville ha uppgift om sin anläggning. Tid. markägaren har sagt att inflitrationsbädd finns på åker på andra sidan vägen. Tillstånd/information saknas i Solen, mapp saknas. Fä ska höra med bonden om han vet när bädden är anlagd, samt ta kontakt med entrep.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3709', 'FOLE LILLFOLE 1:24', '2019-08-26', 'Kontakt i ärendet', 'FAÄ ringer in och pratar med Arent på kundtjänst. FAÄ behöver ha kontakt med handläggare då bygglov uppgett att dem saknar efterfrågat underlag, FAÄ är även rådfrågande till hur dem skall gå vidare.
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3818', 'HELLVI VIVLINGS 1:38', '2018-12-27', 'Kontakt i ärendet', 'FÄ undrade om hur man kan lösa avloppet för fastigheten. Svårt att hitta plats för ny WC-infiltration. Vill ansluta kommunalt men jag meddelade att inga nya anslutningar görs nu. Informerade FÄ om att man bör avvakta Lav-anmälan för Hideviken, möjligen gör TF bedömningen om RG får ansvara för VA i Hide att man passar på att lösa problemet med Valleviken samtidigt. Jag meddelade FÄ om att jag ska föreslå för KV att man avvaktar LaV-beslutet från LSt och tills att man vet att det inte blir aktuellt med Kommunalt avlopp. FÄ informerades om de gärna kan höra med grannarna och ändå planera för en egen lösning. FÄ i området vill bli meddelade om vad som gäller för just dem. KV får göra specialutskick till dem, hur de ska förhålla sig till KV-utskicket. Erik har varit inblandad i de 5 fast. som idag är anslutna till kommunalt Avlopp. Klart vatten informeras om detta vi mejl, samt kopia till Erik.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3815', 'HELLVI VIVLINGS 1:37', '2018-10-17', 'Kontakt i ärendet', 'Fastigheten står med på intresselista för kom. VA Hellvi GA 13. Vi avvaktar tills vi vet mer om detta.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3810', 'HELLVI VIVLINGS 1:23', '43409', 'Kontakt i ärendet', 'Står på intresselista för gem. VA Hellvi GA:13. / FT');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3916', 'HELLVI VIVLINGS 1:142', '2018-12-27', 'Kontakt i ärendet', 'Fä undrar om tiden för åtgärd, ska eventuellt ansöka om gemensam anläggning (BDT+tank) med Vivlings 1:143. Har fått VA-yttrande i tidigare ägarens bygglovsansökan som innefattar långt rör till servitut, vilket inte är relevant för nuv. fä. Får informaition om hur de ska gå tillväga med ansökan.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3761', 'HELLVI VIVLINGS 1:111', '2018-12-13', 'Kontakt i ärendet', 'Fä ringde och undrade hur lång tid de hade på sig. De har begärt offert från tre entreprenörer. Var även lite orolig att grannens avloppsanläggning skulle hamna för nära sin vattenbrunn. Informerade om att den inte får läggas inom 50 m. Har skickat ansökningsblanketten via e-post.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3756', 'HELLVI VIVLINGS 1:108', '2019-01-23', 'Kontakt i ärendet', 'En av fastighetsägarna ringde (son till tidigare fä). Intresseanmälan ska finnas för påkoppling till komm. VA, redan förberett till tomtgräns. Han ska prata med TKF igen. Vi avvaktar.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3791', 'HELLVI STENGRINDE 1:22', '2018-11-08', 'Kontakt i ärendet', 'Mikael Pagroth undrade vad som ska göras. Jag meddelade att han ska ta kontakt med sakkunnig/grävare för att utforma en ansökan. Mikael fick lista på lokala entreprenörer via e-post (bifogas). Mikael fick information om vilka tider som gäller för fastigheten.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3790', 'HELLVI STENGRINDE 1:19', '2018-09-14', 'Kontakt i ärendet', 'Från: Klartvatten 
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4215', 'STENKUMLA KÄLLGÅRDS 1:43', 'NULL', 'röd', 'Ej mapp');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4211', 'STENKUMLA KÄLLGÅRDS 1:30', 'NULL', 'röd', 'Mapp finns');
