INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3725', 'HELLVI SAJGS 1:54', '2019-06-17', 'Kontakt i ärendet', 'Hej,
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3716', 'HELLVI SAJGS 1:44', '2017-12-13', 'Kontakt i ärendet', 'Fä ringde. Det som behövs förbättras är BDT. A3 omr. Prata med granne. Bad fä avvakta med ansökan. Hideviken. Prövning för KOM. Bad fä återkoppla till oss i juni 2018. Då vet vi kanske mer. / Jennie Ljungberg');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3715', 'HELLVI SAJGS 1:43', '2018-11-28', 'Kontakt i ärendet', 'FaÄ undrade varför de fått påminnelseutskick. Grannen har fått information om att alla fastigheter i Hideviken ska avvakta med ev. åtgärd, och att Klart Vatten-ärendet """"pausas"""". Jag meddelade att uppgifterna stämmer och att ingenting förväntas från dem förrän de hör annat. Därmed ska de inte ta hänsyn till påminnelseutskicket som gått ut till dem av misstag.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3711', 'HELLVI SAJGS 1:40', '2019-09-19', 'Information om-Felaktigt utskick ang komVA anslutning-HIDE', 'Kontakt med FaÄ och informerade om att det blivit felutskick till fastigheter ang kommunal VA anslutning i HIDE. Mailar entreprenörslista samt information till FaÄ./AN');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3689', 'HELLVI NYSTUGU 1:36', '2018-12-10', 'Kontakt i ärendet', 'FaÄ vill göra en gemensam anl. med flera grannar. Får info om hur ansökningsblanketten ska fyllas i. Får info om att de inte behöver skicka in något förns oktober 2019. Ska diskutera med grannar först då de inte valt entreprenör ännu, Skickar in ansökan lite längre fram. / FT');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4042', 'HELLVI NYSTUGU 1:29', '2019-07-01', 'Information om', 'plats för BDT 1 hushåll finns i bef, inf. på Hellvi Sudergårde 1:33, beslut Hellvi Nystugu 1:31.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4041', 'HELLVI NYSTUGU 1:19', '2019-06-25', 'Kontakt i ärendet', 'Har pratat med dotter till faä som ville ha information om vad som krävs på fastigheten. Har hänvisat till tidigare mailkonversation som jag hittade under ärendet. Dotter och son ska återkoppla detta år gällande plan och process för komplettering av markbädd. / Mathias (msem)');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4030', 'HELLVI NORRGÅRDE 1:14', '2019-05-08', 'Information om', 'Huset är ej bebott och avloppet ska pluggas, enligt uppgift från entreprenör Bertil Malmberg, som är entreprenör i ett annat ärende med samma fastighetsägare (MBNV-2019/4032). Bertil ska inkomma med dokumentation när detta är gjort.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4025', 'HELLVI MALMS 2:6', '2019-07-23', 'Kontakt i ärendet', 'FAÄ ringer in och meddelar att man hört att grannfastighet har varit i kontakt med handläggare på Klart Vatten gällande den potentiella ansluteningen till kommunalt VA via Hideviken. FAÄ ska ändå skicka in ansökan. / Mathias (msem)');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4008', 'HELLVI MALMS 1:27', '2018-11-12', 'Kontakt i ärendet', 'Hej,
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3994', 'HELLVI MALMS 1:22', '2019-03-05', 'Kontakt i ärendet', 'E-postkonversation om frågan om kommunal anslutning eller ej. se bifogad fil.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3993', 'HELLVI MALMS 1:17', '2018-12-06', 'Kontakt i ärendet', 'Kontaktpers ringde. Fä mkt gammal o bor på hemmet. Hus står tomt. Finns ett enkelt köksavlopp, direktutsläpp. Ska ej säljas utan behållas i släkten, men inte användas just nu. Vi diskuterade plombering av köksavloppet  och verififiering av detta val via skrift/foto och/eller kvitton till KV mail för avslut av ärende. Ska inkomma senast okt 2019. / JL');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3697', 'FOLE LILLA SOJDEBY 1:19', '2018-11-27', 'Kontakt i ärendet', 'FaÄ, Johan Malmqvist, fick lite info om vilka uppgifter vi behöver i ansökan. Han ska söka tillstånd i efterhand för en anläggning omgrävd 2007 utan tillstånd.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3692', 'FOLE LILLA SOJDEBY 1:12', '2019-03-08', 'Kontakt i ärendet', 'Fä ringer och meddelar att han gjort en gemensam anläggning tillsammans med grannen 2008. Tillstånd saknas, men grannen har beslut; 2006-2851. Fä får ansöka om tillstånd i efterhand varpå prövning görs. Handlingar från arkivet på grannens ärende skickas till fä.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3685', 'FOLE LILLA HELLVIS 1:24', '2018-12-28', 'Kontakt i ärendet', 'Fä undrade om de var försent ute pga påminnelseutskicket. Har ett gammalt tillstånd från -78. För dialog med grannarna om ev gem. anläggning.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3674', 'FOLE KISSLINGS 1:12', '2018-11-12', 'Kontakt i ärendet', 'Fä orolig om vi har rätt fa bet. När fä köpte huset stod det 1:2. Jag sa att fa kan ha bytt fa bet men, att jag ska kolla upp detta när vårt kartsystem åter är i funktion. Fä var orolig över påminneslen men har fått info om att det finns gott om tid än. Fä har fått en ansökan och ska vända sig till en entrep för att få hjläp med att utforma förslag. Hänvisade fä till avloppsguiden. / JL');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3929', 'HELLVI KYRKEBOLS 1:17', '2018-11-02', 'Kontakt i ärendet', 'Hej,
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3678', 'HELLVI BARDUNATORP 1:2', '2018-11-29', 'Kontakt i ärendet', 'Maria Vide undrade över vilka tider som gäller samt hur ansökan går till. Hon fick generell information om hur ansökan tas fram samt information om vilka tider som gäller i hennes ärende. Gör ev gemensam ansökan med 1:1.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3802', 'FOLE VATLINGS 1:8', '2019-09-12', 'Kontakt i ärendet', 'FaÄ på besök. Ville ha allmän info om tiden när ansökan ska vara inne samt anläggningen utförd. Skulle fundera lite på hur han skulle göra med slamavskiljare och rådfråga entreprenör. Gav FaÄ ansökningsblanketter./AN');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3797', 'FOLE VATLINGS 1:5', '2018-11-08', 'Kontakt i ärendet', 'På tillståndet i annat MHN ärende låter det som att vtn inte finns indraget. Har bett fä bekräfta innan avslut. / JL');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3825', 'FOLE VATLINGS 1:13', '2019-09-05', 'Kontakt i ärendet', 'FaÄ på besök med frågor om ansökan. Tanken är att göra gemensamt med tre andra fastigheter. Undrade om alla måste koppla på samtidigt då en fastighet skulle ha en annan entreprenör som skulle gräva för en extra 3kb då den kommer ansöka för ett extra utsläpp. Allmänna frågor om infiltrationsbäddar och om pumpbrunn./AN');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3759', 'FOLE STORA RYFTES 1:27', '43518', 'Kontakt i ärendet', 'Svar på mejl:
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4182', 'STENKUMLA GARDRUNGS 1:71', 'NULL', 'röd', 'PB=89-06-14. /Mapp finns/Markbädd någt för gammal och för liten för 3 hushåll/');
