INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3673', 'FOLE KISSLINGS 1:10', '2019-03-05', 'Kontakt i ärendet', 'Fä Gunnel meddelar att de varit i kontakt med entrep som ska komma ut och titta på fastigheten inför gemensam anläggning med en granne. De har varit i kontakt flera ggr och påmint entrep. Informerat om att de har till och med oktober på sig och att de kan via avloppsguiden hitta anrda entrep om tilltänkt inte hinner.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4117', 'BRO TORS 1:22', '2019-05-21', 'Kontakt i ärendet', 'Fä på besök. Flera fa ska göra gem. Ansökan påbörjad. Finns buffertzon för Själsön att ta hänsyn till. / JL');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4087', 'BRO STENSTUGU 1:14', '43488', 'Kontakt i ärendet', 'Svar på mailfråga:
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4161', 'BRO KYRKOGÅRDEN 1:1', '2018-11-13', 'Kontakt i ärendet', 'Fastighetsskötare vid Bro kyrka, ringde och undrade hur de ska gå vidare i ärendet. Då det finns en avloppstak för WC+handfat (enligt tidigare kontakt i ärendet) i kyrkan, meddelar jag att de för ansöka om tillstånd i efterhand, Jag meddelade att de ska lämna så mycket information som möjligt om tanken (ålder, typ, entreprenör mm), samt att det kan bli aktuellt att kontrollera täthet och funktion i eller i samband med handläggning av ärendet. Skickar ansökningsblankett och entreprenörslista till ansvarig (se bifogad fil).');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4051', 'BRO DACKER 1:12', '2018-11-07', 'Kontakt i ärendet', 'Fastighetsägare, Jonas Strömberg tfn 0706345115, undrar hur han ska gå vidare i ärendet. Jonas ombads att kontakta en entreprenör för att diskutera om befintlig anläggning är ok eller inte, och därefter antingen styrka att anläggningen är ok eller att skicka in en ansökan. Jonas fick lista på verksamma entreprenörer skickad via e-post.');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4048', 'BRO BRANDHAGEN 1:2', '2018-11-07', 'Kontakt i ärendet', 'Fastighetsägare, Hallberg, var orolig för att Klart Vatten skulle göra tillsyn. Han fick svaret att han ska lämna in ansökan (planerar att göra gemensam anläggning med granne) senast oktober 2019, och att vi inte gör någon tillsyn innan dess. Hallberg avser att komma på besök för att få hjälp.');
