INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-3886', 'RUTE PUTTERSJAUS 1:39', 'NULL', 'röd', 'Gemensamt med 1:29, 1:37 och 1:21. Mapp saknas, se Puttersjaus 1:29>10. Beslut finns men ej om den är påkopplad på gem infiltration/CS');
INSERT INTO tempExcel.dbo.[2019-10-02-förbud_1] (Diarienummer, Fastighet, Händelsedatum, Rubrik, Text) VALUES ('MBNV-2019-4208', 'RUTE PUTTERSJAUS 1:30', 'NULL', 'röd', 'Huvudbyggnad + samlingslokal. Ett äldre avlopp finns för verkstad + fd ladugård, finns ej beslut, PB 990430 kurslokal i uthus. Mapp finns och beslut. Utförd? Uppgift på att det är upp till 12 familjer där på sommeren har inkommit. /MAN');
