INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN GARTARVE 4:10', 'Har indraget vatten men dåligt och ont om vatten, spenderar mkt lite tid i huset. Har rening för BDT från 79. Vill inte göra nytt, vill inte plombera.', 'Kontakt i ärendet', 'Inkommande', '2015-06-08 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2287', 'MBNV-2019-2922');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN GARTARVE 4:10', 'FÄ har anmält intresse och tänker ansluta sig till Nygranne utveckling (gemsamhetsanläggning) för vatten och avlopp.', 'Kontakt i ärendet', 'Inkommande', '2015-07-20 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2287', 'MBNV-2019-2922');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN GARTARVE 4:10', 'FÄ ringer och berättar att det första gemensamhetsprojektet inte blev av (efter samtal med Rickar Widén) Han kommer nu vänta och se om det andra projektet av samma (Bendelin) blir av isf hoppar han på det. Han ringer igen när han får påminelse med status', 'Kontakt i ärendet', 'Inkommande', '2016-01-12 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2287', 'MBNV-2019-2922');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN GARTARVE 4:10', 'FÄ och var orolig över avloppet och ekonomin. Har anmält intresse till den gemensamma VA anläggningen i Grynge. Men kan dra ut på tiden, meddelar att finns han med på lista så får han isf uppskov', 'Kontakt i ärendet', 'Inkommande', '2016-05-25 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2287', 'MBNV-2019-2922');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN GARTARVE 4:10', null, 'Kontakt i ärendet', 'Inkommande', '2017-03-02 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2287', 'MBNV-2019-2922');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN GARTARVE 4:10', 'Ansökan är på gång. Fä vill informera om detta. Har en entreprenör, Katthammarsvik Gräv AB. /JL', 'Kontakt i ärendet', 'Inkommande', '2017-04-11 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2287', 'MBNV-2019-2922');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN GARTARVE 4:10', 'FÄ ringer och berättar att det första gemensamhetsprojektet inte blev av (efter samtal med Rickar Widén) Han kommer nu vänta och se om det andra projektet av samma (Bendelin) blir av isf hoppar han på det. Han ringer igen när han får påminelse med status', 'Kontakt i ärendet', 'Inkommande', '2017-04-24 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2287', 'MBNV-2019-2922');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN GARTARVE 4:10', 'Fä lyckades inte med uppladdningen men har stämt träff med mig imorgon. Vi ser igenom ansökan och därefter lämnas den till mig. /JL', 'Kontakt i ärendet', 'Utgående', '2017-04-27 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2287', 'MBNV-2019-2922');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN GARTARVE 4:10', null, 'Kontakt i ärendet', 'Inkommande', '2017-07-06 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2287', 'MBNV-2019-2922');
