INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN GANNARVE 1:20', 'Pratade med FÄ om de utförandeintyg som skickats in. FÄ har just nu inget vatten indraget och använder en torrlösning för wc. Inväntar bygglov för ett attefallshus där han planerar att ha WC till den gemensamma bädden med 1:19 och 1:18. Han skulle skicka in ett nytt utförandeintyg när han lagt ner slamavskiljaren. Skulle även återkomma med information om slamavskiljaren på 1:19 och 1:18 som är hans far och (farbror?). Anläggningen togs i bruk i september 2016. 
