INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN SKOGBY 4:4', 'Fastighetsägaren vill koppla på en ny gemensam anläggning i gammelgarn (Gunnar Bendelin) och fastigheten finns med på intresselista. Fastighetsägaren vill avvakta att ta tillståndet i anspråk tills dess att frågan om en gemensam anläggning är utredd. Om det blir ett verk vill han koppla på fastighetens v/a till det. Bedriver uthyrningsverksamhet på fastigheten under sommarmånaderna, vilket ger en hög belastning.. Har ingen rening alls idag, inte ens en tvåkammarbrunn. Har meddelat att vi tycker att det inte är lämpligt att bedriva den sortens verksamhet när fastigheten saknar avlopp, men att vi inte kan förbjuda dem att göra det. Fastighetsägaren återkopplar till mig om hur det blir med den gemensamma anlöäggningen.', 'Kontakt i ärendet', 'Utgående', '2017-08-24 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2498', 'MBNV-2019-2978');
