INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA BURGE 1:33', 'FÄ ringde ang utskick. Har resorption från 1980. Ska kontakta enreprenör och skicka in ansökan.', 'Kontakt i ärendet', 'Inkommande', '2015-07-08 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2598', 'MBNV-2019-3006');
