INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA BURGE 1:33', 'Remiss åter från LST. Ärendet kräver ingen dispens gällande naturreservat Gotlands kusten eller från strandskyddet.', 'Information om', null, '2017-01-26 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2598', 'MBNV-2019-3006');
