INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARNS ANNEX 1:2', 'Fä vill försäkra sig om att ansökan inkommit. Fä vill bli uppringd av handläggare när det e dags för handläggning, tfn: 0702610699. Fä vill inte ha förbud på sitt avlp o hoppas på snabb o effektiv handläggning. /JL', 'Kontakt i ärendet', 'Inkommande', '2017-02-08 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2620', 'MBNV-2019-3010');
