INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA ETEBOLS 1:48', null, 'Information om avlopp', 'Inkommande', '2015-08-05 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2644', 'MBNV-2019-3022');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA ETEBOLS 1:48', 'Avloppsanl. utförd 2001 utan tillstånd. FÄ har fått ansökan skickad till sig och ska fylla i den efter bästa förmåga (tillstånd i efterhand ). Hon vet inte vem som utförde arbetet eller hur anl. är utförd, men fotodokumentation finns. Marianne', 'Kontakt i ärendet', 'Inkommande', '2015-07-29 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2644', 'MBNV-2019-3022');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA ETEBOLS 1:48', 'Jag har kontaktat FÄ för att be om kompletteringar av ansökan. FÄ berättar att det finns dokumentation (skrivet och foton) på vad som finns för anläggning. Efter samtal med Jennie kom de fram till att FÄ gör en ny ansökan i efterhand och skickar in.', 'Kontakt i ärendet', 'Inkommande', '2016-10-31 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2644', 'MBNV-2019-3022');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA ETEBOLS 1:48', 'Kontaktperson ringde för fä. Fick tips om hur ansökan ska fyllas i. /JL', 'Kontakt i ärendet', 'Inkommande', '2016-11-25 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2644', 'MBNV-2019-3022');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA ETEBOLS 1:48', null, 'Tillsynsprotokoll', null, '2017-06-07 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2644', 'MBNV-2019-3022');
