INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA ETEBOLS 1:48', 'Har försökt nå FÄ angående kompletteringar i avloppsärendet. Jag var ute på plats 2015-01-20. 3kb gick då ej öppna. Någon inf syntes ej (gömdes den under snön?). FÄ behöver komplettera ansökan med info om inf, ifall det finns befintlig.', 'Kontakt i ärendet', 'Utgående', '2016-06-21 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2644', 'MBNV-2019-3022');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA ETEBOLS 1:48', null, 'Kontakt i ärendet', 'Utgående', '2017-03-09 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2644', 'MBNV-2019-3022');
