INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA ÖVERSTEKVARN 1:55', 'Av ngn anledning fick jag Henrics ansökan till min mail. Har skickat en kopia av ansökan till registraturen 2017-02-27. Har skrivit till fä att vi vill ha en ansökan också för de andra fa. /JL', 'Kontakt i ärendet', 'Inkommande', '2017-02-27 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2822', 'MBNV-2019-3067');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA ÖVERSTEKVARN 1:55', null, 'Kontakt i ärendet', 'Inkommande', '2017-02-08 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2822', 'MBNV-2019-3067');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA ÖVERSTEKVARN 1:55', null, 'Kontakt i ärendet', 'Inkommande', '2017-11-22 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2822', 'MBNV-2019-3067');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA ÖVERSTEKVARN 1:55', 'Fä berättar att infiltrationen grävts om gemensamt med 1:56, utan tillstånd, ca år 2007. De inkommer med ansökan i efterhand inom kort.', 'Kontakt i ärendet', 'Inkommande', '2015-06-03 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2822', 'MBNV-2019-3067');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA ÖVERSTEKVARN 1:55', 'FÄ undrar vad som behöver göras. Undrar om grannen skickat in ansökan för dem. Ingenting har inkommit på denna eller 1:56. Jag informerar om att de ska komma in med varsin ansökan i efterhand, med så mycket info som möjligt om anläggningen.', 'Kontakt i ärendet', 'Inkommande', '2016-10-24 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2822', 'MBNV-2019-3067');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA ÖVERSTEKVARN 1:55', null, 'Kontakt i ärendet', 'Utgående', '2018-01-19 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2822', 'MBNV-2019-3067');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA ÖVERSTEKVARN 1:56', 'FÄ på 1:55 (grannen) ringde in och berättade att de grävt om den gemensamma infiltrationen ca år 2007. De ska nu ansöka om tillstånd i efterhand. 1:55 sa att han ska berätta detta för 1:56.', 'Kontakt i ärendet', null, '2015-06-03 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2825', 'MBNV-2019-3068');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA ÖVERSTEKVARN 1:56', null, 'Inspektionsrapport', 'Utgående', '2017-10-13 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2825', 'MBNV-2019-3068');
