INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA KINNER 1:97', 'Entrep utförde avloppet hösten 2017 (troligen aug/sept). Han har lämnat in intyget två gånger, andra gången direkt till Regionen nu i maj, i ett kuvert (med ett flertal andra intyg)t. Entrep vill inte åka ut en tredje gång till fä och KV tycker inte heller att han behöver det eftersom det troligen är för att vi  bytt ärendesystem som detta problem uppstått. / JL', 'Kontakt i ärendet', 'Inkommande', '2018-06-25 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2660', 'MBNV-2019-3030');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA KINNER 1:88', null, 'Avlopp - utförandeintyg', 'Utgående', '2018-06-26 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2648', 'MBNV-2019-3024');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA LUNDBJÄRS 1:27', 'Intern kommunikation.', 'Information om', 'Upprättad', '2018-05-02 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2674', 'MBNV-2019-3038');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA NYHAMN 1:56', 'Fä ville ha information i ärendet då han missat e-post på grund av fel mailadress. Sammanställde de fyra senaste kontakterna i ärendet och mailade över dessa till honom. Marianne', 'Kontakt i ärendet', 'Inkommande', '2018-06-29 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2755', 'MBNV-2019-3055');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA ÖVERSTEKVARN 1:56', null, 'Ansökan/anmälan om enskild avloppsanläggning - förbättring', 'Inkommande', '2018-05-29 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2825', 'MBNV-2019-3068');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN SKOGBY 4:17', 'Fä meddelar att den granne som han har beslut om att göra gemensamt avlopp med, inte kommer att nyttja sitt tillstånd. De ska istället gå med i större gem. anl. Fä för denna fastighet kan därför inte nyttja sitt beslut. Vi kom överrens om att han skickar in en ny ansökan. EV. gör han anl. ihop med annan granne som har beslut för inf. i gränsen mellan fastigheterna (Skogby 4:8).', 'Kontakt i ärendet', 'Utgående', '2018-07-06 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2481', 'MBNV-2019-2973');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN SKOGBY 4:17', 'Fä på besök. Tillstånd för gem BDT med grannen 1:17. Nu ska grannen 1:17 ansluta till Herrvik. Fä vill därför göra BDT på egen tomt (då det nu inte är mening att dra ledning över till 1:17). Pg finns med ca 1 meter till 1,5 meter sand (upgft från fä). Fä/entrep tycker inte att det är lönt att vi åker ut. ""Finns registrerad pg ca 5 meter från fä:s provgrop i vår karta. Visar också sand"". //Fä:s pg ligger i skogsdunge. Vid beslutskrivande tas hänsyn till sly, träd samt närliggande väg!// Fä ska komplettera sin ansökan lite dvs. mäta ut avstånd till närliggande vtn brunnar. Ärendet ska hanteras som PRIO! Reducerad avgift om vi inte behöver åka ut. Invänta ansökan./JL', 'Kontakt i ärendet', 'Inkommande', '2018-07-10 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2481', 'MBNV-2019-2973');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('ÖSTERGARN BENGTS 1:40', 'Ersättningsbeslut med tillägg om WC-tank. Marianne', 'Beslut om enskild avloppsanläggning BDT + Tank', 'Utgående', '2018-07-11 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-1871', 'MBNV-2019-2795');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('ÖSTERGARN BENGTS 1:40', 'Sluten tank till WC tillagd till ansökan, efter samtal med Fä. Marianne', 'Komplettering, rev. ansökan', 'Utgående', '2018-07-11 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-1871', 'MBNV-2019-2795');
