INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN SKOGBY 4:17', '1) Pratat med entrep. Ny 2kb och infiltration för BDT. Osäker på vad fä vill. 2) Ringt fä. Uppgifterna från entrep stämmer. 3) Fä har lagt ner sluten tank enligt tillståndet som skrevs10 nov 2016. Jag bad fä skicka in intyg på den nedlagda tanken så har vi detta avklarat. 4) Fä funderar på att återta sin nya ansökan. Vill söka för ECObox.  / JL', 'Kontakt i ärendet', 'Utgående', '2018-09-03 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2481', 'MBNV-2019-2973');
