INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA NYHAMN 1:56', 'Fastighetsägaren hörde av sig, för att han hade läst i beslutet att det skulle vara en ny sluten tank för WC. Det hade inte avsett, och var inte medveten om att entreprenören fyllde i detta i ansökan. Jag reviderar beslutet enligt fastighetsägarens önskan.', 'Kontakt i ärendet', 'Inkommande', '2018-11-06 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2755', 'MBNV-2019-3055');
