INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA NYHAMN 1:56', 'Revidering, från ny tank till befintlig, samt reviderad e-postadress.', 'Reviderad ansökan enskilt avlopp', 'Inkommande', '2018-11-08 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2755', 'MBNV-2019-3055');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA NYHAMN 1:21', 'Lägger in lite foton från den besiktning jag gjorde för länge sedan. / JL', 'Komplettering', 'Upprättad', '2018-11-14 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2671', 'MBNV-2019-3036');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('ÖSTERGARN GROGARNS 1:54', 'Enligt Kjell vid Gustafssons gräv är det på gång att lämnas in en ansökan om gemensam anläggning, där denna fastighet ska kopplas på. Det planeras för en anläggning för ca 5 hushåll. Marianne', 'Kontakt i ärendet om ärendegång', 'Inkommande', '2018-11-22 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-1951', 'MBNV-2019-2835');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('ÖSTERGARN GROGARNS 1:47', 'Enligt Kjell vid Gustafssons gräv är det på gång att lämnas in en ansökan om gemensam anläggning, där denna fastighet har chans att  koppla på sig. Det planeras för en anläggning för ca 5 hushåll. Kontaktade Gudrun för att höra hur hon ser på det. Hon behöver lite mer tid på sig att bestämma om hon vill vara med i den genensamma anl. eller göra en egen. Marianne', 'Kontakt i ärendet', 'Inkommande', '2018-11-21 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-1950', 'MBNV-2019-2834');
