INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN SKOGBY 4:8', 'Ringt entrep. Det ska inte vara en ny 2kb som står i ansökan. Det är en felskrivning. Det ska göras en singelbädd för utloppsvatten eftersom dike/vattendrag inte finns. Entrep vet inte vilka mått. Sa att det är en enklare liten infiltration. Eventeullt komplettera med måtten efter att ha rådfrågat leverantur, men jag sa att jag återkopplar. Ska titta på insamlat data i ärendet först. / JL', 'Kontakt i ärendet', 'Utgående', '2019-01-15 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2505', 'MBNV-2019-2982');
