INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('ÖSTERGARN GROGARNS 1:54', 'FaÄ för 1:46 var på besök för att lämna in ansökan. Planerar gemensam infiltration med 1:54. 1:46 har förvärvat en gammal militäranläggning med 3kb på 18m2 som de planerar att använda. De har grävt 3 pg men de ska lägga igen två av dem för att det var för nära berg. En av groparna var bra, den behålls. Informerade om A3, men ansökan är gemensam.', 'Kontakt i ärendet', 'Inkommande', '2019-01-15 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-1951', 'MBNV-2019-2835');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA BURGE 1:164', 'Fä´s make ringde angående beslutet. Ville få kopia på handlingar.  Informerade om tidskraven. Mailat handlingar.', 'Kontakt i ärendet', 'Inkommande', '2019-01-18 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2580', 'MBNV-2019-3002');
