INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN SKOGBY 4:17', null, 'Komplettering - provgropbesiktning', 'Inkommande', '2018-11-30 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2481', 'MBNV-2019-2973');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN SKOGBY 4:17', 'Fä hade gem beslut med grannfa men grannfa ska gå med i samfällighet o fä ville inte då ensam göra en gigantisk bädd på grannfa tomt enligt det beslut som fanns. Eftersom den andra grannen hade beslut på infiltr i hörnet av sin tomt tänkte fä anlägga en likadan bädd brevid den, fast på sin tomt och på så vis infrias A3 villkoret. Eftersom ärendet prövats i grannfa ärende (grop) behövs inte ärendet prövas på samma sätt som avloppsärende varför fä får reducerad avgift på sitt tillst. Det är ca 40 m till grannfa vtn brunn vilket är ok för BDT med bra mark. WC-tank finns enligt tidigare beslut och den är utförd och nedlagd./ JL', 'Beslut om enskild avloppsanläggning BDT', 'Utgående', '2019-03-01 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2481', 'MBNV-2019-2973');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN SKOGBY 4:8', 'Försökt nå fä på tfn. Behöver mer uderlag. Gett fä mitt nr på mobilsvararen. / JL', 'Kontakt i ärendet', 'Utgående', '2019-01-29 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2505', 'MBNV-2019-2982');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA NYHAMN 1:38', null, 'Ansökan/anmälan om enskild avloppsanläggning - förbättring', 'Inkommande', '2019-01-31 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2701', 'MBNV-2019-3045');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA NYHAMN 1:38', null, 'Bekräftelsekort', 'Utgående', '2019-01-31 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2701', 'MBNV-2019-3045');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA BURGE 1:92', 'Svarat Elin. Frågat vad det är hon vill ha från oss eftersom det inte tydliggörs i hennes mail. Hon har fått information om tillsysnplan och möjliga lösningar för en eventuell försäljning. / JL', 'Kontakt i ärendet', 'Inkommande', '2019-02-01 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2636', 'MBNV-2019-3019');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN SKOGBY 4:8', 'Det är fä som gjort ansökan. Det ska inte vara någon infiltration/markbädd som mottagare. Fä har ritatat ut singelbädd vid ecobox. Meningen är att gräva ut ett litet dike och fylla med singel som en stenkista. Bilden i produktbilagan visar hur fä tänkt sig det hela. Vi pratade lite om A3 villkoren och att detta ser ut att leda till 2 olika avloppslösningar i området. Fä förstod detta men vill ha sin ansökan prövad ändå. / JL', 'Kontakt i ärendet', 'Utgående', '2019-02-01 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2505', 'MBNV-2019-2982');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN SKOGBY 4:8', null, 'Kontakt i ärendet', 'Utgående', '2019-02-01 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2505', 'MBNV-2019-2982');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('ÖSTERGARN RODARVE 2:3', null, 'Beslut om enskild avloppsanläggning BDT+ WC', 'Utgående', '2019-02-06 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2232', 'MBNV-2019-2902');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('ÖSTERGARN RODARVE 2:3', 'Platsbesök har gjorts vid två tillfällen, båda protokollen ligger i samma dokument. Marianne', 'Komplettering, provgropsbesiktning och reviderad ansökan', 'Upprättad', '2019-02-06 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2232', 'MBNV-2019-2902');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN SKOGBY 4:8', 'Ringt entrep och meddelat att jag skickat kompl begäran via mail till fä. Entrep sa att han själv anser att han kan för lite om ecobox, det är nytt och lägger kompletteringsbegäran på fä:s eget ansvar. / JL', 'Kontakt i ärendet', 'Utgående', '2019-02-19 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2505', 'MBNV-2019-2982');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN SKOGBY 4:17', 'Ringde entrep eftersom ansökan är ofulltsändig. Sa att i en av våra tfn kontakter fick jag veta att ny 2kb skulle till men att jag glömmde fråga om infiltra st. Fick veta att den ska vara 14 kvm eftersom det är sandigt och fint. Jag informerade entrep om att det är en del vtn brunnar i omr. Jag sa att det är bra att hålla 5 meter från den mindre vägen, dels för att inte hindra evnt trafik men också för att få ngt större avstånd till 4 :7 som ligger nedströms österut. Det finns sedan tidigare ett beslut på grannfa för BDT inftr på 14 kvm menar entrep/jag men, jag tycker ändå att man kan dra bädden lite uppåt. Jag sa att jag hållit på fä:s beslut eftersom jag prövar grannen men, kommit fram till att grabnens beslut kan dröja eftersom det nu handlar om kompletteringsbegäran till ofullständig ansökan och att jag därför beslutar att gå vidare med denna ansökan. Entrep höll med om detta (samma entrep till båda fastigheterna). / JL', 'Kontakt i ärendet', 'Utgående', '2019-02-19 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2481', 'MBNV-2019-2973');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN SKOGBY 4:17', 'Ansökan reviderad. Finns i detta ärende en tfn kontakt där både entrep/fä menar att det ska till en ny 2kb och att tanken är nedsatt enligt förgående beslut. Nu idag den 19/2 ny tfn kontakt som avser infiltr 14 kvm. / JL', 'Komplettering - Reviderad ansökan', 'Utgående', '2019-02-19 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2481', 'MBNV-2019-2973');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA KINNER 1:73', 'Fä kontaktar KV kundtjänst (mail) och undrar om intyget är registrerat. Ja, men vi saknar reviderad sitplan. Har skickat kompletteringsbegäran. / JL', 'Kontakt i ärendet', 'Inkommande', '2019-03-01 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2643', 'MBNV-2019-3021');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA KINNER 1:73', 'VB:ad till handläggare MN för godkännande.', 'Komplettering rev situationsplan', 'Inkommande', '2019-03-06 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2643', 'MBNV-2019-3021');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA KINNER 1:73', 'Ok från MN, meddelat fä att den är komplett och att vi avslutar ärendet.', 'Komplettering - komplett situationsplan', 'Inkommande', '2019-03-08 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2643', 'MBNV-2019-3021');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('ÖSTERGARN DJUPVIKE 1:19', 'Då inte Max längre är i livet, har en av döttrarna (?) kontaktats, Josefin Ahlström. Hon kontaktades via telefon och sedan mailade jag över lite handlingar i ärendet samt annan information, se bifogat. De kommer att få ett år till på sig att utföra avloppet enligt överenskommelse med Josefin. Marianne', 'Kontakt i ärendet', 'Utgående', '2019-03-21 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-1882', 'MBNV-2019-2803');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('ÖSTERGARN DJUPVIKE 1:20', 'Då inte Max längre är i livet, har en av döttrarna (?) kontaktats, Josefin Ahlström. Hon kontaktades via telefon och sedan mailade jag över lite handlingar i ärendet samt annan information, se bifogat. De kommer att få ett år till på sig att utföra avloppet enligt överenskommelse med Josefin. Marianne', 'Kontakt i ärendet', 'Utgående', '2019-03-21 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-1883', 'MBNV-2019-2804');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN SKOGBY 1:27', 'Fä på besök. Avlopp ej påbörjat och tillståndet löper ut om ca 3 ve. Fä önskar få tillståndet förlängt. Fä ska ansluta till Nygarns vatten och avlopp (se bekräftelse på avtalet nedan) men, hurruvida anslutning är möjligt kommer fä att få besked om senare i år. Fä vill av den anledning inte bli av med sitt tillstånd. / JL', 'Kontakt i ärendet', 'Inkommande', '2019-03-28 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2563', 'MBNV-2019-2998');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN SKOGBY 1:27', 'Tidigare handläggare SF.', 'Beslut om enskild avloppsanläggning BDT', 'Utgående', '2019-03-29 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2563', 'MBNV-2019-2998');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA NYHAMN 1:21', 'Robert Bjersander på Länsstyrelsen ringde angående detta ärende. Han menar att vi skulle tagit beslut om avvisning på Anders Löfvebergs (Lummelunda Nyhamn 1:9) överklagan, jag hittar inget sånt beslut. Ber handläggare ringa upp Robert när hon är tillbaka.', 'Kontakt i ärendet', 'Inkommande', '2019-04-11 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2671', 'MBNV-2019-3036');
