INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN SKOGBY 4:8', 'Skickar kopia av grannfastighetens beslut (beslutet ska kommuniceras eftersom det är tätt mellan grannar och vattenbrunnar). . / JL', 'Kontakt i ärendet', 'Utgående', '2019-04-24 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2505', 'MBNV-2019-2982');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN SKOGBY 4:17', 'Jag har idag skickat ut beslutet för denna fastighet till omrkingliggande grannar (beslutet är kommunicerat). / JL', 'Kontakt i ärendet', 'Utgående', '2019-04-24 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2481', 'MBNV-2019-2973');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN HAUGSTAJNS 1:16', 'Eva ringde och informerade om att de ännu inte fått några projektmedel för att genomföra avloppsanläggningarna. De söker vidare och ska söka LONA/LOVA -bidrag. Har varit i kontakt med personer MBN och vill ha dessa delaktiga i projektet, även diskuterade med ekostrateg.
