INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('ÖSTERGARN FILIPPUSE 1:5', 'Fä ringer och meddelar att utförandeintyget kommer skickas in under nästa vecka, nu skickat till entrep. för sign.', 'Kontakt i ärendet', 'Inkommande', '2019-04-29 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-1925', 'MBNV-2019-2822');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA KINNER 1:88', 'Granne ringer och meddelar att han tror bädden är underdimensionerad. Ser att besiktning villkorats, utförandeintyg inkommit i juni 2018. Skickar vidare till handläggare.', 'Kontakt i ärendet', 'Inkommande', '2019-04-29 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2648', 'MBNV-2019-3024');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA NYHAMN 1:21', 'Avvisning utgående till Anders Löfveberg på grannfastigheten 1:9. Skickar också kopia till Länstyrelsens jurist via e-post idag samt kopia till bitr chef Carin Södergren. / JL', 'Överklagande av beslut - Avvisning', 'Utgående', '2019-05-02 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2671', 'MBNV-2019-3036');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA NYHAMN 1:21', 'Har ringt entrep. Han vet att enskilt avlopp för 1:21 inte blir av. Entrep meddelade mig att han ska göra det gemensamma avloppet på Övre Vägen och att det i just nu är oklart om avloppet på nedre väg blir av. Han sa att om Christer önskar så finns möjlighet att hänga på avloppet på övre vägen. Jag sa att jag ska kolla upp detta. Informerade också att om Christer önskar få sitt tillstånd på nytt kan jag inte neka honom detta men, att jag i första hand ska höra om han inte kan tänka sig ett gemensamt avlopp med sina grannar. / JL', 'Kontakt i ärendet', 'Utgående', '2019-05-02 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2671', 'MBNV-2019-3036');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('ÖSTERGARN FILIPPUSE 1:5', null, 'Avlopp - utförandeintyg', 'Inkommande', '2019-05-07 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-1925', 'MBNV-2019-2822');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA NYHAMN 1:21', 'Fä informerar att Länstyrelsen först avvisat överklagandet men, senare ändrat sig. Fä sa att han fick 1 dygn på sig att inkomma med synpunkter till LST vilket fä menar är ytterst lite tid. //Nu funderar fä på att sälja men, vill inte lämna över ärendet i detta skick till nya ägare. //Jag informerade fä om vad Janssons Gräv sagt dvs. 1) fä får gärna vara med på Övre Vägen i gemensamhets anläggning om fä önskar och ska i så fall kontakta firman. Fä sa att han ska ringa firman redan på måndag. Fä e orolig över hur Länsstyrelsen ställer sig till denna gemensamm anläggning; om LST kommer att riva upp ett sådant beslut och jag vågar tyvärr inte svara på detta. // Jag informerade fä att KV också kan förnya och förstärka hans enskilda avloppsbeslut. Fä ska funder/undersöka och återkoppla med besked. / JL', 'Kontakt i ärendet', 'Utgående', '2019-05-08 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2671', 'MBNV-2019-3036');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA NYHAMN 1:21', 'Fä ringde idag och berättade att han pratat med Janssons Gräv. Tillsammans har man utrett möjlighterna att ansluta 1:21:an till den övre vägens gemensamma avlopp men, slutligen landat i det förslag som tidigare getts med enskilt avlopp för 1:21:an.  Vid anslutning till övre vägen måste avloppsvattnet pumpas upp från 1:21:an mot övre vägen och detta visade sig efter närmare funderingar mellan fä/entrep vara tekniskt mer komplext att utföra. Fä/entrep har enats om att det enskilda avloppet på 1:21:an lämpar sig bättre för denna fastighet. Jag sa till fä att jag ska se över ärendet en gång till vad gäller enskilt avlopp. / JL', 'Information om', 'Inkommande', '2019-05-09 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2671', 'MBNV-2019-3036');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('LUMMELUNDA NYHAMN 1:21', 'Ringt entrep. Entrep menar att en gemsanm lösning med övre vägen är ett bra förslag och möjlighet att utföra detta tekniskt finns. Jag sa att jag uppfattat det på fä som att det inte var möjligt. // Jag informerade att fä nu önskar enskilt avlopp. Sa till entrep att inte utföra något avlopp förrän jag återkopplar. Det finns för närvarande inget beslut för fastigheten eftersom länsstyrelsen rivit upp detta. // Vi hade en dialog kring BDT-avloppet och båda är eniga om att situationsplanen måste förtydligas eftersom den ger ett vilseledande intryck. 2kb däremot bör kvarstå placerad närmare vägen för slamtömmning.// Vi pratade om BDT-avloppet och om möjligheterna att öka ytan till 35 kvm. Det är blandat material i mark lera/sand, ngt tätt men, eftersom det ena huset är fritidshus har bedömmning gjorts att 30 kvm-35 kvm bör vara tillräckligt. Eftersom beslutet rivits upp och för grannar upplevs som otryggt kan det vara aktuellt vid ny prövning av ärendet att utöka ytan på bädden till 35 kvm. // JL', 'Kontakt i ärendet', 'Utgående', '2019-05-10 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2671', 'MBNV-2019-3036');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('ÖSTERGARN BENGTS 1:40', 'Samtal med fastighetsägaren. Ger besked att tiden när avloppet ska vara åtgärdat går ut 2019-05-28. Efter kontakt med entr. lämnas uppgift att avloppet inte kan förbättras förrän efter sommaren. Troligen kring månadsskiftet aug/sep.', 'Kontakt i ärendet', 'Inkommande', '2019-05-10 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-1871', 'MBNV-2019-2795');
INSERT INTO tempExcel.dbo.[4årsPåmvår2019] (Ärendets_huvudfastighet, Text, Rubrik, Riktning, Händelsedatum, Kommentar, Diarienummer) VALUES ('GAMMELGARN HAUGSTAJNS 1:16', 'Eva ringde 190510 och diskuterade projektet och eventuella ändringar av sin egen anläggning. Hon vill ha mer information om avloppsdammar, mailar informationsblad till henne 190513 /CS', 'Klart vatten - information om avlopp', 'Inkommande', '2019-05-13 00:00:00.0000000', 'Tidigare Dnr: MHN-2015-2343', 'MBNV-2019-2947');
