Hej
Vi har fått en påminnelse i ovanstående ärende. Nu vill vi förklara varför vi inte har återkommit i ärendet. 

Ert ursprungliga brev kom förrahösten när vi hade stängt vårt fritidshus i Hellvi för vintern. Tanken var att vi skulle sätta igång med ansökan när vi kom ut igen på våren, vi hade ju två år på oss att åtgärda saken. 

När vi så kom ut i slutet av mars upptäckte vi att vi hade drabbats av en svår vattenskada som gjorde huset i princip obeboeligt. Eftersom vi därmed har haft hantverkare i och kring huset hela sommaren och större delen av hösten har det inte fungerat att samtidigt gräva sönder tomten, de har behövt den delen där den befintliga infiltrationsbädden ligger för parkering av fordon och för att ibland förvara byggmaterial. 

Reparationsarbetena är nu äntligen slutförda och vi kunde åka ut senaste helgen för att gå igenom och godkänna arbetena. När vi kom hem igen låg er påminnelse och väntade på oss.

Det ursprungliga brevet från er har tyvärr förkommit i kaoset som uppstod så vi har dålig koll på i vilken ordning vi måste göra åtgärderna.  Nu har vi ju vinterstängt huset igen. Vi kan säkert få dit någon som gräver en provgrop men för resten av arbetet känner vi att vi behöver vara på plats.

Tacksam för besked om hur snabbt vi behöver agera och om det räcker med en provgrop så länge. 

Vänliga hälsningar
Kjersti Jones');

