Hej, 

Tack för ditt meddelande. 

Ja, vad synd att meddelandena inte hade nått dig. Jag ville inte jaga på, utan tänkte ge dig tid att återkomma med förslag på hur vi ska gå vidare i ärendet. Men nu i efterhand så ser jag, att det nog hade varit bättre att kontakta dig per telefon också. Nu skickar jag detta mail till båda dina mailadresser. 

När vi gör bedömningar i avloppsärenden, är de alltid specifika för den fastighet/avloppsansökan ansökan gäller. Om ett skyddsavstånd på 50 m inte kan uppnås, får en försöka hitta en lösning där fullgod rening kan uppnås. Ett utsläpp av BDT-vatten kan i detta fall godtas på platsen för den besiktigade provgropen, trots att skyddsavståndet är mindre än 50 m. Eftersom marksammansättningen är något grov (grusig, stenig sand) och inget tätare lager kunde ses i provgropen, finns risk att en fullgod rening ej kan ske, om vattnet passerar marken alltför fort; speciellt för WC-vattnet där merparten av bakterierna finns. Något nytillkommande WC-utsläpp kan vi inte godkänna på denna plats.

Jag tittade lite på avloppsanläggningarna hos dina grannar i vårt arkiv och ser att ett avstånd på 50 m uppnås hos 1:57 och 1:58. På 1:55 finns villkor om att den skyddsavstånd på 50 m ska uppnås. 

Jag får återigen be dig fundera på om du vill revidera ansökan till WC-tank + BDT-infiltration, om du vill att jag skriver avslag på befintlig ansökan (går att överklaga; tänk på att det då blir en avgift för avslaget och en för kommande beslut) eller om du vill göra ett nytt försök att hitta en plats för lämplig placering av provgrop för nytt WC-utsläpp. 

Idag går jag på semester och är åter den 13 augusti. Du är välkommen att skicka in kompletteringar under tiden, så att vi kan gå vidare i ärendet efter sommaren. 

Vänliga hälsningar, Malin Friis 
