Hej!

Tack för ditt meddelande och dina synpunkter. 

Som du ju vet, så är krävs mycket goda markförutsättningar för att ett nytt utsläpp av WC-vatten ska tillåtas. Dessa förutsättningar uppfylls tyvärr inte vid de provgropar som vi har besiktigat på din fastighet. Den ena gropen uppvisade en grov marksammansättning (stenig, sandig grus) och befann sig för nära vattentäkterna och de andra två provgroparna har uppvisat en tät marksammansättning av siltig lera eller liknande. De sistnämna har för dålig genomsläpplighet, för att ett nytt WC-utsläpp ska kunna godkännas. Vi godkänner inte nya utsläpp av WC-vatten under dessa förutsättningar; alltså inte heller inte i form av en förstorad infiltration. Som du ju ser på din egen fastighet, kan marksammansättningen skilja sig mycket åt, på närliggande platser – både mellan provgropar på din egen fastighet, men även mellan provgropar på din respektive grannars fastigheter. 

Enligt överenskommelse vid senaste besiktningen, får jag därför be dig att avgöra, om du vill gå vidare med ansökan om BDT+tank, om du vill leta efter ytterligare provgropar, eller om du vill gå vidare till avslag i ditt ärende. 

Vänligen återkom med besked om vilken av dessa vägar vi ska gå. 

Mvh/Malin Friis 


